import ProjectCard from '../list_projects_page/ProjectCard'

import {ProjectsWarp} from "../list_projects_page/styles"

class ProjectList extends Component{
    render(){
        return(
            
            <ProjectsWarp>
                
                <ProjectCard/>
                <ProjectCard/>
                <ProjectCard/>
                <ProjectCard/>
                <ProjectCard/>
                
            </ProjectsWarp>
        )
    }
}

export default ProjectList
